import './App.css';
import React from 'react';  
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Header from "./components/component.header"; 
import Subheader from "./components/component.studentAdd";
import Home from "./components/component.home";
import Alert from "./components/component.Alert"
import Login from "./components/login"
import Register from "./components/component.register"
import SlideMenu from "./components/slide"
function App() {

  return (
    <BrowserRouter> 
     <div className="App">
      {/* <Header /> */}


    </div>  
        <Routes>
          <Route path='/home' exact element={<Home />} />
          <Route path='/add' exact element={<Subheader />} />
          <Route path='/register' exact element={<Register />} />
          <Route path='/login' exact element={<Login />} />
          <Route path='/menu' exact element={<SlideMenu />} />

        </Routes>
      </BrowserRouter>  
);


}

export default App;
